import React from 'react';
import {Route} from 'react-router-dom';
import {connect} from 'react-redux'

import CollectionsOverviewContainer from '../../components/colelctions-overview/collections-overview.container'
import CollectionPageContainer from '../collection/collection.container';
import { fetchCollectionsStart } from '../../redux/shop/shop.actions';
 
class ShopPage extends React.Component{
    componentDidMount() {
        const {fetchCollectionsStart} = this.props;

        fetchCollectionsStart();
    }

    render() {
        const {match} = this.props;
        return(
            <div className='shop-page'>
                <Route exact path={`${match.path}`} component={CollectionsOverviewContainer}></Route>
                <Route path={`${match.path}/:collectionId`} component={CollectionPageContainer}></Route>
            </div>
        )
    }
}

const mapDispatchToProps = dispatch => ({
    fetchCollectionsStartAsync: () => dispatch(fetchCollectionsStart())
});



export default connect(null, mapDispatchToProps)(ShopPage);
